import * as React from "react";
import { useForm } from "react-hook-form";
import axios from 'axios';
import Headers from "./Header";
import "./styles.css";


let renderCount = 0;

type FormValues = {
  date: string;
  tradeid: string;
  clientid: string;
};

export default function App() {
  const {
    register,
    handleSubmit,
    formState: { errors }
  } = useForm<FormValues>();

  return (
    <div>
    <form
      onSubmit={handleSubmit((data) => {
        console.log(data);
        var user_params = {};

        if (data.date!="" && data.clientid=="" && data.tradeid=="") {
          console.log(data.date)

          axios({
            method: 'get',
            url: '/trades/date/' + data.date
          })
          .then(function (response) {
            const results = document.getElementById("results")
            const p = document.createElement("p")
            const query_label = <label>GTT breaks for date {data.date}</label>
            p.id = "result-box"
            p.textContent = JSON.stringify(response.data)
            console.log(response)
            results?.appendChild(query_label)
            results?.appendChild(p);
          }

          );
        }
        else if (data.date=="" && data.tradeid!="" && data.clientid=="") {
          axios({
            method: 'get',
            url: '/trades/tradeid/' + data.tradeid
          })
          .then(function (response) {
            const results = document.getElementById("results")
            const p = document.createElement("p")
            p.id = "result-box"
            p.textContent = JSON.stringify(response.data)
            console.log(response)
            results?.appendChild(p);
          });
        }
        else if (data.date=="" && data.tradeid=="" && data.clientid!="") {
          user_params = {
            "tradeID": data.tradeid,
          };
          axios({
          method: 'get',
          url: '/trades/clientid/' + data.clientid
        })
        .then(function (response) {
            const results = document.getElementById("results")
            const p = document.createElement("p")
            p.id = "result-box"
            p.textContent = JSON.stringify(response.data)
            console.log(response)
            results?.appendChild(p);
        })
        }
        else {
          console.log("No data")
        }


      })}
    >
      <Headers
        renderCount={renderCount}
        description="Please enter data into only one of the search fields."
      />
      <label htmlFor="date">Query by Date:</label>
      <input
        {...register("date", { 
          maxLength: { value: 8, message: "Input date as YYYYMMDD." }
        })}
        id="date"
      />
      {errors.date && <p>{errors.date.message}</p>}

      <label htmlFor="tradeid">Query by TradeID:</label>
      <input
        id="tradeid"
        {...register("tradeid")}
      />

      <label htmlFor="clientid">Query by ClientID:</label>
      <input
        id="clientid"
        {...register("clientid")}
      />

      <input type="submit" />

    </form>
    <div>
      <div id="results"> 
      </div>
    </div>
    </div>
  );
}
